.top-bar {
  display: flex;
  justify-content: space-between;

  &--footer {
    flex-direction: column;
    gap: 48px;

    @include onTable() {
      gap: 24px;
    }

    @include onDesktop() {
      flex-direction: row;
    }
  }

  &__left-section {
    display: flex;
    align-items: end;
    gap: 32px;
  }

  &__logo {
    @include hover(transform, scale(1.1));
  }

  &__icon-menu {
    position: relative;
    width: 24px;
    height: 24px;

    &::after,
    &::before {
      position: absolute;
      left: 3px;

      content: "";

      width: 18px;
      height: 2px;
      background-color: $header-text-color;
    }

    &::after {
      top: 8px;
    }

    &::before {
      bottom: 8px;
    }

    &--close {
      &::after {
        top: 11px;
        transform: rotate(45deg);
      }

      &::before {
        bottom: 11px;
        transform: rotate(-45deg);
      }
    }

    @include hover(transform, scale(1.1));

    @include onDesktop() {
      display: none;
    }
  }

  &__nav {
    display: none;

    @include onDesktop() {
      display: block;
    }

    &--footer {
      display: block;
    }
  }

  &__button-hire-us {
    position: relative;
    z-index: 1;

    font-weight: 700;
    line-height: 150%;

    letter-spacing: 3px;
    text-transform: uppercase;

    @include hoverUnderline();
  }
}

